import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const FooterSection = styled.footer`
  min-height: 100vh;
  background: #000000;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;
  overflow: hidden;
`;

const BlotterContainer = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 100%;
  opacity: 0.4;
  pointer-events: none;
`;

const Content = styled.div`
  position: relative;
  z-index: 1;
  text-align: center;
  padding: 2rem;
`;

const Links = styled.div`
  display: flex;
  gap: 2rem;
  margin-top: 2rem;
  justify-content: center;
`;

const Link = styled.a`
  color: #ffffff;
  text-decoration: none;
  font-size: 1.2rem;
  font-family: 'Comic Sans MS', cursive;
  transition: color 0.3s ease;

  &:hover {
    color: #00ff00;
  }
`;

const Copyright = styled.p`
  color: #ffffff;
  margin-top: 2rem;
  font-family: 'Comic Sans MS', cursive;
`;

export const Footer: React.FC = () => {
  return (
    <FooterSection>
      <BlotterContainer>
        <BlotterText 
          text="SQUANCH" 
          size={400}
          fill="rgba(255,255,255,0.1)"
        />
      </BlotterContainer>
      <Content>
        <Links>
          <Link href="#" target="_blank">Telegram</Link>
          <Link href="#" target="_blank">Twitter</Link>
          <Link href="#" target="_blank">Discord</Link>
          <Link href="#" target="_blank">Medium</Link>
        </Links>
        <Copyright>
          Â© 2024 SquanchCoin. All rights squanched.
        </Copyright>
      </Content>
    </FooterSection>
  );
};
